package com.leetcode.learning.q680;

public class Solution {


    public boolean validPalindrome(String s) {
        if(null == s || s.length() <= 2){
            return true;
        }
        int left = 0, right  = s.length() -1;
        while (left < right) {
            if(s.charAt(left)!= s.charAt(right)){
                //skip left
                boolean leftRet = true;
                int tmpL = left + 1, tmpR = right;
                while (tmpL < tmpR){
                    if(s.charAt(tmpL)!=s.charAt(tmpR)){
                        leftRet = false;
                        break;
                    } else {
                        tmpL++;
                        tmpR--;
                    }
                }
                if(leftRet){
                    return true;
                }

                //skip right
                tmpL = left;
                tmpR = right-1;
                boolean rightRet = true;
                while (tmpL < tmpR){
                    if(s.charAt(tmpL)!=s.charAt(tmpR)){
                        rightRet = false;
                        break;
                    } else {
                        tmpL++;
                        tmpR--;
                    }
                }
                if(rightRet){
                    return true;
                }
                return false;

            }else {
                left++;
                right--;
            }
        }
        return true;
    }

    public boolean validPalindrome2(String s) {
        if(null == s || s.length() <= 2){
            return true;
        }
        if(validSubString(s)){
            return true;
        }
        String test = "";
        for (int i = 0; i < s.length(); i++) {
            if(i==0){
                test = s.substring(1);
            }else if (i == s.length() -1){
                test = s.substring(0, s.length()-1);
            }else {
                test = s.substring(0,i) + s.substring(i+1);
            }
            if(validSubString(test)){
                return true;
            }
        }
        return false;
    }

    private boolean validSubString(String s){
        int length = s.length();
        int leftIndex = length/2 - 1;
        int rightIndex = length%2==0? length/2: length/2+1;
        boolean isEqual = true;
        int j = rightIndex;
        for (int i = leftIndex; i >=0 ; i--,j++) {
            if(s.charAt(i) != s.charAt(j)){
                isEqual = false;
                break;
            }
        }
        if(isEqual){
            return true;
        }
        return false;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        boolean ret = solution.validPalindrome("");
        System.out.println(ret);
    }
}
